import React from "react";

import "../../index.css";
import LandingPageNavbar from "./sections/LandingPageNavbar";

import Me from "../../assets/me.jpeg";
import { Col, Row, Card } from "react-bootstrap";
import { Link } from "react-router-dom";

const LandingPage = () => {
  return (
    <div>
      <LandingPageNavbar />
      <div className="container " style={{marginTop:"150px"}}>
        <div className="full">
          <Row className="">
            <Col md="8">
              <h2 className="h2-responsive mt-3 mb-2">404. That's an error.</h2>
              <h4>The requested URL was not found on this server.</h4>
            </Col>
            <Col md="4">
              <img
                alt="Error 404"
                className="img-fluid"
                src="https://mdbootstrap.com/img/Others/grafika404-bf.png"
              />
            </Col>
            <Link to="/">Back to Home</Link>
          </Row>
        </div>
      </div>
    </div>
  );
};

export default LandingPage;
